const styles=()=>({
    content:{
        minWidth: '100%',
        paddingRight: '2%',
        paddingLeft: '2%',
        paddingTop: '2%',
    },
    button:{
        paddingBottom: '2%',
        fontSize: '90%'
    },
    text:{
        fontSize: '1.5rem',
        textAlign: 'center',
        fontWeight: '800',
        
    },
    modalDelete:{
        height:'25%',
        backgroundColor: '#fff',
    },
    modalConfimText:{
        textAlign: 'center',
        fontSize: '80%',
    },
    box:{
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
    },
    modalConfimTextBold:{
        color:'#FF0000',
        fontSize: '1em',
        fontWeight: 800,
    },
    button1:{
        fontSize: '50%',
        margin: "2px",
        marginBottom: '20%',
    },
    textTd:{
        padding: '0em',
        marginBottom: '1%',
        marginTop: '1%',

    }
});
export default styles;
